syntax = "proto3";

option java_package = "layla.sleep.proto";

import "GILKJDIJOIG.proto";
import "PALOPENLFFM.proto";

// Name: GCGCard
message GCGCard {
    uint32 guid = 15;
    uint32 id = 13;
    bool is_show = 14;
    repeated PALOPENLFFM OOBKPOINHFK = 9;
    repeated uint32 tag_list = 8;
    repeated uint32 skill_id_list = 7;
    repeated GILKJDIJOIG AAOCEJCBOBD = 2;
    uint32 face_type = 11;
    uint32 controller_id = 10;
}

